pragma solidity ^0.4.2;

import "contracts/token/MintableToken.sol";
import "contracts/token/BurnableToken.sol";
import "contracts/math/SafeMath.sol";


/**
*'SIPT' 'Save Ideas Patent Token' token contract
* Symbol      : SIPT
* Name        : Save Ideas Patent Token / Save Ideas Token
* Total supply: 1 300 000 000.000000000000000000
* Decimals    : 18
*/
contract SIPT is MintableToken, BurnableToken {
    using SafeMath for uint;

    string public constant name = "Save Ideas Token";
    string public constant symbol = "SIPT";
    uint8 public constant decimals = 18;

    /**
    * maxTokens = 1, 300, 000, 000
    * PreSale = 780, 000, 000
    * Crowdsale = 195, 000, 000
    * Reserve =  130, 000, 000
    * Team = 65, 000, 000
    * Advisors = 65, 000, 000
    * Bounty = 65, 000, 000
    */

    uint256 public maxTokens = 1300000000000000000000000000; // There will be total 1 300 000 000 SI Tokens
    uint256 public totalTokensForSaleDuringPreICO = 780000000000000000000000000; // 78 000 0000 tokens for PreSale
    uint256 public totalTokensForSale = 195000000000000000000000000; // 195 000 000 for Crowdsale
    uint256 public totalTokensReserve = 130000000000000000000000000; //13 000 0000 for reserve
    uint256 public totalTokensForTeam = 65000000000000000000000000; // 65 000 000 for team
    uint256 public totalTokensForAdvisors = 65000000000000000000000000; // 65 000 000 for advisors
    uint256 public totalTokensForBounty = 65000000000000000000000000; // 65 000 000 for bounty


    /**
    * SIPT constructor
    * Mints token for PreSale once created
    */
    function SIPT() public Owned(msg.sender) {
        mint(address(this), totalTokensForSaleDuringPreICO);
    }

    function mintForSale() public onlyOwner {
        mint(address(this), totalTokensForSale);
    }

    function mintReserveTokens(address _reserveAddress) public onlyOwner {
        require(_reserveAddress != address(0));
        mint(_reserveAddress, totalTokensReserve);
    }

    function mintForBounty(address _bountyWallet) public onlyOwner {
        require(_bountyWallet != address(0));
        mint(_bountyWallet, totalTokensForBounty);
    }

    function mintForTeam(address _teamWallet) public onlyOwner {
        require(_teamWallet != address(0));
        mint(_teamWallet, totalTokensForTeam);
    }

    function mintForAdvisors(address _advisorsWallet) public onlyOwner {
        require(_advisorsWallet != address(0));
        mint(_advisorsWallet, totalTokensForAdvisors);
    }
}
